import React from 'react';
import logo from './logo.svg';
import './App.css';

import { IgrPieChartModule } from "igniteui-react-charts/ES5/igr-pie-chart-module";

IgrPieChartModule.register();

var data = [
    { MarketShare: 30, Company: "Google",    },
    { MarketShare: 30, Company: "Apple",     },
    { MarketShare: 15, Company: "Microsoft", },
    { MarketShare: 15, Company: "Samsung",   },
    { MarketShare: 10, Company: "Other",     },
];

export class App extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        items: [],
        isLoaded: false,
      }
    }

    componentDidMount() {
      fetch('http://developer.trimet.org/ws/v2/vehicles/appID/CC57D2038B76DBBD253D6A587')
        .then(res => res.json())
        .then(json => {
            this.setState({
              isLoaded: true,
              items: json,
            });
          }
        )
    }

    render() {

      var { isLoaded, items } = this.state;

      if (!isLoaded) {
        return <div>Loading...</div>;
      }

      else {

        return(
          <div class="container">
            {items.resultSet.vehicle.map(item => (
              <div key={item.tripID} class="vehicle">
                <div>{item.type}</div>
                <div>{item.signMessageLong}</div>
                <div>{item.routeNumber}</div>
              </div>
            ))}
          </div>
        )
      }
    }
}

export default App;
